Starring: 

Stefani Morgan, Franchezca Valentina, Aarielle Alexis, Manuel Ferrara, Lee Stone, Ben English, Van Damage

Description: 

This is the story of a British gangster named Jenkins. Jenkins owns a seedy strip club that offers what men desire and much more. Jenkins also happens to be the distributor of a sexual aphrodisiac called &quot;HONEYSUCKLE&quot;. A highly addictive drug that makes girls unbelievably horny! Dodgson and Andrea are federal agents assigned to infiltrate the club, and put an end to it's illegal business. Dodgson goes in as a patron and Andrea as a stripper. See the tale unravel as Andrea works the dance pole like a pro and even takes the illicit drug in order to avoid being exposed. Will Andrea blow her cover... or blow the customers. Watch as Stefani Morgan unleashes her sexual inhibitions in 200 Proof. We promise it'll have you coming back for more.

